import React, { useState } from "react";
import { GoogleMap, LoadScript } from "@react-google-maps/api";
import Header from "./components/Header";
import GuessrHelp from "./components/GuessrHelp";
import Training from "./components/Training"; // Assurez-vous que ce composant existe

const API_KEY = "AIzaSyAf7UIljn6JDxuDYjCJm3o4NR4DzrdK4tA";
const mapContainerStyle = { height: "400px", width: "100%" };
const center = { lat: 48.858844, lng: 2.294351 };

const App = () => {
  const [activeTab, setActiveTab] = useState("guessr_helpr");

  const handleTabChange = (tab) => {
    setActiveTab(tab);
  };

  return (
    <LoadScript googleMapsApiKey={API_KEY} libraries={["places"]}>
      <div>
        <Header activeTab={activeTab} onTabChange={handleTabChange} />
        {activeTab === "guessr_helpr" && <GuessrHelp />}
        {activeTab === "training" && <Training />}
        {activeTab === "map" && (
          <div style={mapContainerStyle}>
            <GoogleMap
              mapContainerStyle={mapContainerStyle}
              center={center}
              zoom={2}
            >
              {/* Vous pouvez ajouter des marqueurs ou autres éléments sur la carte ici */}
            </GoogleMap>
          </div>
        )}
      </div>
    </LoadScript>
  );
};

export default App;
